// add ---

function add(req, res) {
    let NewMosaic = req.body;

    let listPecas = new Array();

    NewMosaic.lista_pecas.forEach(itemPeca => {

        let imageBuffer = new Buffer(itemPeca.imagem_peca.split(",")[1],"base64");
        itemPeca.imagem_peca = { "title": itemPeca.imagem_peca.split(",")[0], "image": imageBuffer };

        let NewMosaicPiece = new PiecesModel(itemPeca);

        listPecas.push(NewMosaicPiece);
    });

    PiecesModel
        .insertMany(
            listPecas
        ).then(function(piecesAdd) {
            //noinspection JSUnresolvedFunction

            let listIds = new Array();
            piecesAdd.forEach(item => {
                listIds.push(item._id.toString());
            });

            NewMosaic.lista_pecas = listIds;

            let imageBuffer = new Buffer(NewMosaic.imagem.split(",")[1],"base64");
            NewMosaic.imagem = { "title": NewMosaic.imagem.split(",")[0] , "image": imageBuffer };

            NewMosaic = new MosaicsModel(NewMosaic);

            NewMosaic.save(_onAddMosaic(res));
        });
}

function _onAddMosaic(res) {
    return function (ErrorSaveMosaic, MosaicSaved) {
        if (ErrorSaveMosaic) {
            return APIService.error(res, 500, 'Mosaico não foi adicionada', ErrorSaveMosaic);
        }

        return APIService.success(res, 200, 'Mosaico adicionada com sucesso', MosaicSaved);
    };
}

// edit ---
function edit(req, res) {

    let NewMosaic = req.body;

    let imageBuffer = new Buffer(NewMosaic.imagem.split(",")[1],"base64");
    NewMosaic.imagem = { "title": NewMosaic.imagem.split(",")[0], "image": imageBuffer };

    //noinspection JSUnresolvedVariable
    NewMosaic = {
        $set: NewMosaic
    };

    //noinspection JSUnresolvedFunction,JSUnresolvedVariable
    MosaicsModel
        .findByIdAndUpdate(req.params.mosaicId, NewMosaic, OptionsUpdate)
        .lean()
        .exec(_onEditMosaic(res));

}

function _onEditMosaic(res) {
    return function (ErrorEditMosaic, MosaicEdited) {
        if (ErrorEditMosaic) {
            return APIService.error(res, 500, 'Mosaico não foi editado', ErrorEditMosaic);
        }

        return APIService.success(res, 200, 'Mosaico editado com sucesso', MosaicEdited);
    };
}


function remove(req, res) {
    const QueryGetByIdMosaic = {
        _id: req.params.mosaicId
    };

    MosaicsModel
        .findOne(QueryGetByIdMosaic)
        .lean()
        .exec(_onRemoveMosaic(res, req.params.mosaicId));
}

function _onRemoveMosaic(res, idMosaic) {
    return function (ErrorUpdateMosaic, MosaicRemoved) {
        if (ErrorUpdateMosaic) {
            return APIService.error(res, 110, 'Erro ao remover mosaico', ErrorUpdateMosaic);
        }

        MosaicRemoved.lista_pecas.forEach(id => {
           PiecesModel.findByIdAndRemove(id).exec();
        });

        MosaicsModel.findByIdAndRemove(MosaicRemoved._id).exec();

        return APIService.success(res, 111, 'Mosaico removido com sucesso', MosaicRemoved);
    };
}


function getAll(req, res) {
    const QueryGetAllMosaics = {
        ativo: true
    };

    MosaicsModel
        .find(QueryGetAllMosaics)
        .populate('lista_pecas')
        .lean()
        .exec(_onGetAllMosaics(res));
}

function _onGetAllMosaics(res) {
    return function (ErrorPopulateAllMosaics, MosaicsPopulated) {
        if (ErrorPopulateAllMosaics) {
            return APIService.error(res, 500, 'Mosaicos não puderam ser obtidos', ErrorPopulateAllMosaics);
        }

        MosaicsPopulated.forEach(item => {
            item.imagem = item.imagem.title + ',' + item.imagem.image.toString('base64');

           let totalLivre = item.lista_pecas.filter(function(piece) {
               return piece.utilizavel === true;
           });

           item.lista_pecas_restantes = totalLivre.length;

           let lista_pecas = new Array();

           item.lista_pecas.forEach(item => {
              lista_pecas.push(item._id);
           });

           item.lista_pecas = lista_pecas;
        });

        return APIService.success(res, 200, 'Mosaicos obtidos com sucesso', MosaicsPopulated);
    };
}


function getAllActive(req, res) {
    const QueryGetAllMosaics = {
        status: true,
        ativo: true
    };

    MosaicsModel
        .find(QueryGetAllMosaics)
        .lean()
        .exec(_onGetAllActiveMosaics(res));
}

function _onGetAllActiveMosaics(res) {
    return function (ErrorPopulateAllMosaics, MosaicsPopulated) {
        if (ErrorPopulateAllMosaics) {
            return APIService.error(res, 500, 'Mosaicos não puderam ser obtidos', ErrorPopulateAllMosaics);
        }

        MosaicsPopulated.forEach(mosaico => {
            mosaico.imagem = mosaico.imagem.title + ',' + mosaico.imagem.image.toString('base64');
        });

        return APIService.success(res, 200, 'Mosaicos obtidos com sucesso', MosaicsPopulated);
    };
}


function getMosaicById(req, res) {
    const QueryGetAllMosaics = {
        ativo: true,
        _id: req.params.mosaicId
    };

    MosaicsModel
        .findOne(QueryGetAllMosaics)
        .populate("lista_pecas")
        .lean()
        .exec(_onGetMosaic(res));
}

function _onGetMosaic(res) {
    return function (ErrorGetAllMosaics, MosaicFound) {
        if (ErrorGetAllMosaics) {
            return APIService.error(res, 400, 'Mosaico não pode ser obtido', ErrorGetAllMosaics);
        }

        MosaicFound.imagem = MosaicFound.imagem.title + ',' + MosaicFound.imagem.image.toString('base64');
        MosaicFound.lista_pecas.forEach(piece => {
            piece.imagem_peca = piece.imagem_peca.title + ',' + piece.imagem_peca.image.toString('base64');
            if(piece.imagem_participante)
                piece.imagem_participante = piece.imagem_participante.title + ',' + piece.imagem_participante.image.toString('base64');
        });

        return APIService.success(res, 500, 'Mosaico obtido com sucesso', MosaicFound);
    };
}


