function qrCodeMosaicGeneration(req, res) {
    const qr = require('qr-image');

    let url = req.body.link;

    const code = qr.imageSync(url, { type: 'png' });

    res.type('png');

    res.send(code);
}


function close(req, res) {
    let NewMosaic = req.body;

    let imageBuffer = new Buffer(NewMosaic.imagem.split(",")[1],"base64");
    NewMosaic.imagem = { "title": NewMosaic.imagem.split(",")[0], "image": imageBuffer };

    const QueryGetAllMosaics = {
        ativo: true,
        _id: req.params.mosaicId
    };

    MosaicsModel
        .findOne(QueryGetAllMosaics)
        .populate('lista_pecas')
        .lean()
        .exec(_onClosePieces(res, req.params.mosaicId, NewMosaic));
}

function _onClosePieces (res, idMosaic, NewMosaic) {
    return function (ErrorPopulateMosaic, MosaicPopulated) {
        if (ErrorPopulateMosaic) {
            return APIService.error(res, 500, 'Não foi possível obter o mosaico.', ErrorPopulateMosaic);
        }

        NewMosaic = {
            $set: NewMosaic
        };

        MosaicsModel
            .findByIdAndUpdate(idMosaic, NewMosaic, OptionsUpdate)
            .exec();

        return APIService.success(res, 200, 'Mosaico fechado com sucesso', {});
    };
}

function compare( a, b ) {
    if ( a.quadranteY < b.quadranteY ){
        return -1;
    }
    if ( a.quadranteY > b.quadranteY ){
        return 1;
    }
    return 0;
}

function _returnLogoImage(fator) {
    return `<img width=`+170*fator+`height=`+221*fator+` src="data:image/png;base64,">`;
}